import React from 'react'

const Header = () => {
    return (
        <div>
            <nav>
                <Link to='/home'>Home</Link>
                <Link to='/tv'>TV</Link>
                <Link to='movie'>Movie</Link>
            </nav>
        </div>
    )
}

export default Header
